const darkColor = "#262726"
const lightColor = "#eaeaea"
const accent = "#cba974";

const theme = {
    light: {
        background: lightColor,
        text: darkColor,
        accent: accent,
    },
    dark: {
        background: darkColor,
        text: lightColor,
        accent: accent,
    }
}

export default theme
